import "./SubmitStyle.css"
import React, { useState } from "react";
export default function Submit(){
    const [selectedFile1, setSelectedFile1] = useState(null);
    function handleFileInputChange1(event) {
      setSelectedFile1(event.target.files[0]);
    }

    const [selectedFile2, setSelectedFile2] = useState(null);
    function handleFileInputChange2(event) {
      setSelectedFile2(event.target.files[0]);
    }
    
    const [selectedFile3, setSelectedFile3] = useState(null);
    function handleFileInputChange3(event) {
      setSelectedFile3(event.target.files[0]);
    }
    return (
        <>
            <div id="submit">
                <div className="button1">
                    <span>Submit your Model</span>
                    <input type="file" onChange={handleFileInputChange1} style={{display:"none"}}/>
                </div>
                <div className="button2">
                    <span>Model and picture</span>
                    <input type="file" onChange={handleFileInputChange2} />
                    <input type="file" onChange={handleFileInputChange3} />
                </div>
            </div>
        </>
    );
}
